function [KP,F,KPcrit] = pMSC(y,tj,fs,alpha)
%
%Product magnitude-squared coherence (pMSC)
%
%Extension of the Magnitude-squared coherence (MSC) concepts to multi
%channel analysis by taking the product of many different MSCs. This is a
%MORD technique that makes use of both
%magnitude and phase and can be used as a detector of hidden periodicities
%in noise, since N real-valued signals are available. The method is
%described in "not yet."  Note: The critical values were obtained via Monte
%Carlo simulations (1e6 iterations)for a maximum of 800 epochs and
%alpha=0.01, 0.05 and 0.1.
%
%Sintaxes:
%
%[KP] = pMSC(y,tj) => pMSC spectrum.
%[KP,F] = pMSC(y,tj,fs) => pMSC spectrum plus frequency vector.
%[KP,F,KPcrit] = pMSC(y,tj,fs,alpha) =>  returns also the critical value.
%
%Input Parameters:
%
%y => matrix whose columns are the signals.
%tj => number of points of each epoch in which the signals will be divided.
%fs => sample rate of signals.
%alpha => significance level, e.g. alpha = 0.05.
%
%Example: pMSC using two signals
%
%y1 = awgn(sin(2*pi*21*(linspace(0,10,1000))),-15,'measured','db')';
%y2 = awgn(sin(2*pi*21*(linspace(0,10,1000))),-16,'measured','db')';
%[KP,F,KPcrit] = pMSC([y1 y2],100,100,0.05);
%figure;plot(F,KP,'b',21,1.05*KP(22),'-rv', [0 50],[KPcrit KPcrit],'k--')
%axis([0 F(end) 0 1]);xlabel('Frequency (Hz)');ylabel('pMSC')

%Leonardo Bonato Felix - Feb/2019


[tamsinal,N] = size(y);
nfft = fix(tj/2)+1;  %number of points for FFT
M = fix(tamsinal/tj); %number of windows
y = y(1:M*tj,:); %limit the signal for a entire number of windows. Prevents shorter windows

%Start of aMSC algorithm ---------------
yfft = fft(reshape(y,[],M,N));

%MSC
MSC1 = zeros(nfft,N);
for jj = 1:N
    
    MSC1(1:nfft,jj) = abs(sum(yfft(1:nfft,1:M,jj),2)).^2./(M*sum(abs(yfft(1:nfft,1:M,jj)).^2,2));
    
end

KP = prod(MSC1,2);%pMSC
KP = (KP).^(1/N);

if nargin > 2
    F = 0:fs/tj:fs/2; %frequency vector
    if nargin == 4
        nRuns = 1e6;
        y  = betarnd(1,M-1,nRuns,N);
        aux = (prod(y,2)).^(1/N);
        KPcrit = quantile(aux,1-alpha);
        %KPcrit = pMSCcrit(N,M,alpha); %simulated critical value
    end
end
end

